import React, {useEffect, useState} from 'react'

function AdminMain() {
    const [userData, setUserData] = useState([])
    useEffect(()=>{
          fetch(`/api/admin/userlist`)
          .then(response => response.json())
          .then(users => {
            setUserData(users);
            console.log(userData);
          })
          .catch(error => console.error(error));
        
        
      }, [])

      const UserDetails = ({ name, surname, login}) => {
        return (
          <div className="elder-details">
            <h2>{name} {surname}</h2>
            <h3>{login}</h3>
            <h3>Location</h3>
            <div className="elder-configuration">
            <button>Red</button>
            <button>Del</button>
            </div>
          </div>
        );
      };

      useEffect(() => {
        console.log(userData);
      }, [userData]);

  return (
    <div className="main-background">
      <div>
        {userData && userData.length > 0 ? (
          userData.map((person, index) => (
            <UserDetails
              key={index}
              name={person.name}
              sirname={person.surname}
              address={person.login}
            />
          ))
        ) : (
          <p>No elder data available.</p>
        )}
      </div>
    </div>
  )
}

export default AdminMain
